import React from 'react';

function Form() {


    const handleClick = (e) => {
        e.preventDefault();
        console.log(e.target);
    }

    return (
        <div className="form">
            <form action="" onSubmit={handleClick}>
                <input type="text" placeholder="Write your Task" name="task" autoComplete="off" />
                <button type="submit">Create it!</button>
            </form>
        </div>

    );
}

export default Form;
